import React from "react";
import "../footer/Footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <div className="container-fluid">
        <div className="row">
          <div className="col-lg-4">
            <div className="lastlinks">
              <ul className="contact d-flex">
                <li><a href=""><box-icon name='instagram' type='logo' ></box-icon></a></li>
                <li><a href=""><box-icon type='logo' name='facebook'></box-icon></a></li>
                <li><a href=""></a><box-icon name='whatsapp' type='logo' ></box-icon></li>
              </ul>
            </div>
          </div>
          <div className="col-lg-4">
            <div className="dev">
              by<span>ZIAD ADEL</span>
            </div>{" "}
          </div>
          <div className="col-lg-4">
            <div className="thanks">ENG/Mohamed Elrafey</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
